from bst import BST
from printExt import printExt

BST.printExt = printExt

# How to use the print function. This is optional, but very helpful for debugging
#BST().add(3).add(1).add(0).add(2).add(5).add(4).add(6).remove(3).remove(1).printExt()



def test(bst, size, height, list, contains, notContains):
    assert bst.size() == size
    assert bst.as_list() == list
    for i in contains:
        assert bst.contains(i) == True
    for i in notContains:
        assert bst.contains(i) == False


test(BST(), 0, 0, [], [], [1,2,3])
test(BST().remove(1), 0, 0, [], [], [1,2,3])
test(BST().add(1), 1, 1, [1], [1], [2,3])
test(BST().add(1).remove(1), 0, 0, [], [], [1,2,3])
